import axiosInstance from '../axios'; // Asegúrate de usar la ruta correcta

export const registerUser = async (userData) => {
    try {
        const response = await axiosInstance.post('register/', userData); // Usa axiosInstance
        console.log('Registro exitoso:', response.data); // Log para depuración
        return response.data; // Devuelve solo los datos de la respuesta
    } catch (error) {
        console.error('Error en el registro:', error.response?.data || error.message); // Log de errores
        throw error; // Propaga el error para manejarlo en el frontend
    }
};
